import { Container, Grid, Box } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    blocForm:{
        background:"#2699B0",
        borderRadius:"10px",
        padding:"1.5rem"
    },

    blocTop:{
    },

    titre:{
        display:"flex",
        gridGap:"0.5rem"
    },

    titreText:{
        color:"#fff",
    },

    img:{
        width: "100px",
        objectFit: "contain"
    }
}));
const FormulaireMobin = () => {
    const classes = useStyles();

    return (
        <Container className={classes.blocForm}>
            <div className={classes.blocTop}>
                <div className={classes.titre}>
                    <h2 className={classes.titreText}>J'adhère à</h2>
                    <img className={classes.img} src={'/static/icons/mobin-webinars.png'} alt="mobin webinar" />
                </div>
                <p>Vous êtes opérateur de mobilité solidaire et vous souhaitez rejoindre le réseau Mob’in ? N’hésitez pas à nous laisser un message par le biais de ce formulaire de contact en indiquant votre région et département.</p>
            </div>
            <div className={classes.form}>
                <form className="flex flex-col">
                    <label htmlFor="name" className="mb-2 italic">Name</label>
                    <input
                        className="mb-4 border-b-2"
                        id="name"
                        name="name"
                        type="text"
                        autocomplete="name"
                        required
                    />
                    <button
                        type="submit"
                        className="px-4 py-2 font-bold text-white bg-blue-500 rounded-full hover:bg-blue-700"
                    >
                        Submit
                    </button>
                </form>
            </div>
        </Container>
    );
};

export default FormulaireMobin;
